import react from 'react';
import {MenuList , MenuItem ,Hidden} from '@material-ui/core';
import {link} from 'react-router-dom';


export function router() {

  return (
    <div>

      <MenuList>
        <MenuItem component={link} to="/">
          Home
        </MenuItem>
        <MenuItem component={link} to="/login">
          Login
        </MenuItem>
      </MenuList>

    </div>
  );

}
